var main = function (argument) {
    $("#lbl-prod-act > a").removeClass("active");
    $("#lbl-resul > a").removeClass("active");
    $( ".list_product" ).click(function(){
        // var id = $(this).closest("ul").closest("li").find("span").html();
        // var programa = $(this).parents("ul").parents("li").find("span").html();
        // $("#lbl-prog").html(programa); //no funciona cuando todavia se ha cargado dicho id
        // $("body").find("#lbl-prog").html(programa);
        var year= $(this).parents("li.year_list").find("span").html();
        var prog= $(this).parents("li.prog_list").find("span").html();
        html = "<div class='nav_page'>Productos y Actividades >> "+year+" >> "+prog+"</div>";
        $("#navigp").html(html);
        $("#lbl-resul > a").removeClass("active");
        $("#lbl-prod-act > a").addClass("active")

    });
    $( ".list_act" ).click(function(){
        // var id = $(this).closest("ul").closest("li").find("span").html();
        // var programa = $(this).parents("ul").parents("li").find("span").html();
        // $("#lbl-prog").html(programa); //no funciona cuando todavia se ha cargado dicho id
        // $("body").find("#lbl-prog").html(programa);
        var year= $(this).parents("li.year_list").find("span").html();
        var prog= $(this).parents("li.prog_list").find("span").html();
        var prod= $(this).parents("li.prod_list").find("span").html();
        html = "<div class='nav_page'>Resultados >> "+year+" >> "+prog+" >> "+prod+"</div>";
        $("#navigp").html(html);
        $("#lbl-prod-act > a").removeClass("active");
        $("#lbl-resul > a").addClass("active")

    });
    $(".prog_list").find("ul").find(".prod_list:last").addClass("border-none")
}

$(document).on('ready',main);

